 mad or upset about something and the emotional maturity to not lash out', 'If you could eat any single food item for the rest of your life what would it be? (e.g.) An answer could be "white rice", "garlic bread", etc. I''m going to disallow something like "Pizza" though that''s too generic. You have to specify >:( at least cmonnn!', 'I''m a golden retriever + cat hybrid type boyfriend. I am the embodiment of this middle ground in that I will shower you with affection but respect and encourage you to have a life outside of the relationship. I love making my partner laugh. I''m a rage baiter :P I want to bully and be bullied 😂', 'Probably not too surprising but I geek out about green technology, science in general, geography, and politics. My YouTube feed is just filled with these types of documentaries.', 'I could never be with a smoker. Cigarettes smoke just smells so bad and it gives me headaches. I also know about the 2nd and 3rd-hand smoking risks and that''s not something I can just ignore.', 39, true, '"2026-01-17T15:07:47.986Z"', '"2026-01-17T14:33:02.349Z"', '"2026-01-17T15:07:47.987Z"');
